import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { BodyComponent } from './body/body.component';
import { DashboardComponent } from './dashboard.component';


@NgModule({
  declarations: [
    DashboardComponent,
    BodyComponent,
  ],
  imports: [
    CommonModule,
  ],
  exports:[
    DashboardComponent,
    BodyComponent,
  ]

})
export class DashboardModule { }
